   "source": [
    "# Case Study 2 - Bellabeat\n",
    "\n",
    "\n",
    "## Summary\n",
    "\n",
    "In this case study scenario, Bellabeat has tasked me, as a junior analyst, to view and analyze trends in in smart device usage so that they can use this information to apply it to their own customers and marketing strategies.\n",
    "\n",
    "## Ask Phase \n",
    "\n",
    "#### What is the problem you are trying to solve?\n",
    "* Trends in smart device usage\n",
    "* How these trends apply to Bellabeat Customers\n",
    "* How these trends can influence Bellabeat's marketing strategy\n",
    "\n",
    "\n",
    "### Business Task \n",
    "* Find and analyze smart device usage trends from non-Bellabeat devices to be able to apply this knowledge to Bellabeat's own customers and marketing strategy\n",
    "\n",
    "Stakeholders \n",
    "\n",
    "* Urška Sršen - Bellabeat cofounder and Chief Creative Officer \n",
    "* Sando Mur - Bellabeat cofounder and key member of Bellabeat executive team \n",
    "* Bellabeat Marketing Analytics team \n",
    "\n",
    "## Prepare Phase\n",
    "\n",
    "#### Dataset used: \n",
    "* [Fitbit Fitness Tracker Data]('https://www.kaggle.com/datasets/arashnic/fitbit'), a dataset made available through [Mobius]('https://www.kaggle.com/arashnic')\n",
    "\n",
    "\n",
    "#### Accessibility and privacy of data: \n",
    "* Data is open-source and license is of the public domain, which makes the data available for everyone to copy, modify, distribute and perform the work, even for commercial purposes, all without asking permission.\n",
    "\n",
    "#### Information about our Dataset: \n",
    "\n",
    "* This dataset generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. Individual reports can be parsed by export session ID (column A) or timestamp (column B). Variation between output represents use of different types of Fitbit trackers and individual tracking behaviors / preferences.\n",
    "\n",
    "#### Data Organization: \n",
    "\n",
    "* Data is organized in 18 .csv Spreadsheets and is in both wide and long format. Below is a summary of the of the files and their descriptions:\n",
    "\n",
    "| CSV Name | File Type | Description |\n",
    "| --- | --- | --- |\n",
    "| dailyActivity_merged | Microsoft Excel CSV | Daily Tracking of Steps, Distance, Intensity, and Calories  |\n",
    "|dailyCalories_merged | Microsoft Excel CSV | Daily Tracking of Calories |\n",
    "| dailyIntensities_merged | Microsoft Excel CSV | Daily Tracking of Intensity, measured in Distance and Minutes, in Sedentary, Lightly Active, Fairly Active,Very Active intensities|\n",
    "| dailySteps_merged | Microsoft Excel CSV | Daily Steps over 31 days of 33 users | \n",
    "| heartrate_seconds_merged | Microsoft Excel CSV | Exact day and time heartrate logs for just 7 users |\n",
    "| hourlyCalories_merged | Microsoft Excel CSV | Hourly Calories burned over 31 days of 33 users |\n",
    "| hourlyIntensities_merged | Microsoft Excel CSV | Hourly total and average intensity over 31 days of 33 users |\n",
    "| hourlySteps_merged | Microsoft Excel CSV | Hourly Steps over 31 days of 33 users |\n",
    "| minuteCaloriesNarrow_merged | Microsoft Excel CSV | Calories burned every minute over 31 days of 33 users (Every minute in single row)|\n",
    "| minuteCaloriesWide_merged | Microsoft Excel CSV | Calories burned every minute over 31 days of 33 users (Every minute in single column)|\n",
    "| minuteIntensitiesNarrow_merged | Microsoft Excel CSV | Intensity counted by minute over 31 days of 33 users (Every minute in single row) |\n",
    "| minuteIntensitiesWide_merged | Microsoft Excel CSV | Intensity counted by minute over 31 days of 33 users (Every minute in single column)|\n",
    "| minuteMETsNarrow_merged | Microsoft Excel CSV | Ratio of the energy you are using in a physical activity compared to the energy you would use at rest. Counted in minutes |\n",
    "| minuteSleep_merged | Microsoft Excel CSV | Log Sleep by Minute for 24 users over 31 days. Value column not specified |\n",
    "| minuteStepsNarrow_merged | Microsoft Excel CSV | Steps tracked every minute over 31 days of 33 users (Every minute in single row)|\n",
    "| minuteStepsWide_merged | Microsoft Excel CSV | Steps tracked every minute over 31 days of 33 users (Every minute in single column) |\n",
    "| sleepDay_merged | Microsoft Excel CSV| Daily sleep logs, tracked by: Total count of sleeps a day, Total minutes, Total Time in Bed |\n",
    "| weightLogInfo_merged | Microsoft Excel CSV | Weight track by day in Kg and Pounds over 30 days. Calculation of BMI.5 users report weight manually 3 users not.In total there are 8 users |\n",
    "\n",
    "#### Data Credibility and Integrity:\n",
    "\n",
    "* Sample Size (30) and no further information about the user demographic could lead to unknown biases. Data set might not be representative of the smart device user base.\n",
    "\n",
    "## Process Phase\n",
    "\n",
    "I will process and analyze the data in R because of its convenience in processing and visualizing data in one place. Another visualization will be available in Tableau.\n",
    "\n",
    "### Installing packages and opening libraries <a class=\"anchor\" id=\"installing_packages_and_opening_libraries_4_1\"></a> \n",
    "\n",
    "We will use the following packages to help us in our cleaning processes and analysis:\n",
    "\n",
    "* tidyverse - for general purposes and visualization\n",
    "* here - for referencing files\n",
    "* skimr - for summarizing data\n",
    "* janitor - for data cleaning\n",
    "* lubridate\n",
    "* ggpubr\n",
    "* ggrepel"
   ]
  },
